import React from "react";
import NavigationItem from "../NavigationItem/NavigationItem";
import styles from './NavigationItems.module.css';
import { useLocation } from "react-router-dom";

const NavigationItems = (props) => {

    const dir = useLocation()

    const dirName = dir.pathname.split('/');

    console.log(dirName);

    return (
        <nav className={styles.NavigationItems}>
            <ul className={styles.ItemsLink}>
                <NavigationItem active link="/">Home</NavigationItem>

                <NavigationItem child="repairs" link={props.navigationPath}>Repairs</NavigationItem>

                <NavigationItem child="sale" link={props.navigationPath}>Sale</NavigationItem>

                <NavigationItem link="/">Accessories</NavigationItem>

                <NavigationItem link="/">About Us</NavigationItem>

            </ul>
        </nav>
    )
}

export default NavigationItems;
